{"version":3,"sources":["webpack://metronic/../demo1/src/js/pages/features/miscellaneous/session-timeout.js"],"names":[],"mappings":";;;;;;AAAa;;AAEb;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA,+CAA+C,MAAM;AACrD;AACA,SAAS;AACT;;AAEA;AACA;AACA;AACA;AACA;AACA;AACA,CAAC;;AAED;AACA;AACA,CAAC","file":"js/pages/features/miscellaneous/session-timeout.js","sourcesContent":["\"use strict\";\r\n\r\nvar KTSessionTimeoutDemo = function () {\r\n    var initDemo = function () {\r\n        $.sessionTimeout({\r\n            title: 'Session Timeout Notification',\r\n            message: 'Your session is about to expire.',\r\n            keepAliveUrl: HOST_URL + '/api//session-timeout/keepalive.php',\r\n            redirUrl: '?p=page_user_lock_1',\r\n            logoutUrl: '?p=page_user_login_1',\r\n            warnAfter: 5000, //warn after 5 seconds\r\n            redirAfter: 15000, //redirect after 15 secons,\r\n            ignoreUserActivity: true,\r\n            countdownMessage: 'Redirecting in {timer} seconds.',\r\n            countdownBar: true\r\n        });\r\n    }\r\n\r\n    return {\r\n        //main function to initiate the module\r\n        init: function () {\r\n            initDemo();\r\n        }\r\n    };\r\n}();\r\n\r\njQuery(document).ready(function() {\r\n    KTSessionTimeoutDemo.init();\r\n});\r\n"],"sourceRoot":""}